import unittest
import Code

class TestDay5(unittest.TestCase):

    def test_reduce_units(self):

        problem = "dabAcCaCBAcCcaDA"
        expected_result = "dabCBAcaDA"

        self.assertEqual("".join(Code.recurse(problem)), expected_result)

    def test_example1(self):

        problem = "dabAcCaCBAcCcaDA"
        expected_result = 10

        self.assertEqual(Code.recurse_problem1(problem), expected_result)

    def test_problem1(self):

        problem = ""
        expected_result = 10132

        self.assertEqual(Code.problem1(problem), expected_result)

    def test_example1_no_recursion(self):

        problem = "dabAcCaCBAcCcaDA"
        expected_result = 10

        self.assertEqual(len(Code.polymerReduc(problem)), expected_result)

    def test_example2(self):

        problem = "dabAcCaCBAcCcaDA"
        expected_result = 4

        self.assertEqual(Code.problem2(problem), expected_result)

    def test_problem2(self):

        problem = ""
        expected_result = 4572

        self.assertEqual(Code.problem2(problem), expected_result)

if __name__ == '__main__':
    unittest.main()
